import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import { Play, Pause, ArrowRight } from 'lucide-react';
import './Hero.css';

const Hero = () => {
  const [isPlaying, setIsPlaying] = useState(true);
  const [currentSlide, setCurrentSlide] = useState(0);

  const heroSlides = [
    {
      title: "Bridging Your Business",
      subtitle: "to a Net-Zero Future",
      description: "Your Way to Net-zero",
      cta: "Scalable Solutions"
    },
    {
      title: "Clean Energy,",
      subtitle: "Custom-built for your vision",
      description: "Navigating the road to net-zero can be complex. We make it simple. Our tailor-made solutions have helped prominent enterprises accelerate their net-zero goals - reliably, and cost-effectively.",
      cta: "Explore Solutions"
    }
  ];

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentSlide((prev) => (prev + 1) % heroSlides.length);
    }, 5000);
    return () => clearInterval(interval);
  }, []);

  const toggleVideo = () => {
    setIsPlaying(!isPlaying);
  };

  return (
    <section className="hero">
      {/* Video Background */}
      <div className="hero-video-container">
        <video
          className="hero-video"
          autoPlay
          muted
          loop
          playsInline
        >
          <source src="https://player.vimeo.com/external/434045526.sd.mp4?s=c27eecc69a27dbc4ff2b87d38afc35f1a9e7c02d&profile_id=164&oauth2_token_id=57447761" type="video/mp4" />
        </video>
        <div className="video-overlay"></div>
      </div>

      {/* Video Controls */}
      <div className="video-controls">
        <button className="video-control-btn" onClick={toggleVideo}>
          {isPlaying ? <Pause size={20} /> : <Play size={20} />}
        </button>
      </div>

      {/* Hero Content */}
      <div className="hero-content">
        <motion.div
          className="hero-text"
          initial={{ opacity: 0, y: 50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 1, delay: 0.5 }}
        >
          <motion.h1
            key={currentSlide}
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: -20 }}
            transition={{ duration: 0.8 }}
            className="hero-title"
          >
            {heroSlides[currentSlide].title}
            <br />
            <span className="hero-subtitle">{heroSlides[currentSlide].subtitle}</span>
          </motion.h1>

          <motion.p
            key={`desc-${currentSlide}`}
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: -20 }}
            transition={{ duration: 0.8, delay: 0.2 }}
            className="hero-description"
          >
            {heroSlides[currentSlide].description}
          </motion.p>

          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.4 }}
            className="hero-cta"
          >
            <a href="#solutions" className="cta-button">
              {heroSlides[currentSlide].cta}
              <ArrowRight size={20} />
            </a>
          </motion.div>
        </motion.div>

        {/* Slide Indicators */}
        <div className="slide-indicators">
          {heroSlides.map((_, index) => (
            <button
              key={index}
              className={`indicator ${index === currentSlide ? 'active' : ''}`}
              onClick={() => setCurrentSlide(index)}
            />
          ))}
        </div>
      </div>

      {/* Floating Elements */}
      <motion.div
        className="floating-elements"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 1.5, delay: 1 }}
      >
        <div className="floating-card card-1">
          <div className="card-icon">‚òÄÔ∏è</div>
          <div className="card-text">Solar Power</div>
        </div>
        <div className="floating-card card-2">
          <div className="card-icon">üå±</div>
          <div className="card-text">Sustainability</div>
        </div>
        <div className="floating-card card-3">
          <div className="card-icon">‚ö°</div>
          <div className="card-text">Clean Energy</div>
        </div>
      </motion.div>
    </section>
  );
};

export default Hero;
